import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import pet.entry.Category;
import pet.entry.Pet;
import pet.PetHTTP;
import pet.entry.Tag;

import java.io.IOException;
import java.util.*;

public class PetHTTPTest {
    private PetHTTP petHTTP;

    @BeforeEach
    public void beforeEach() {
        petHTTP = new PetHTTP();
    }

    @Test
    public void testThatCreateNewPetMethodWorksCorrect() throws IOException, InterruptedException {
        Pet expectedPet = new Pet(1111113322,
                new Category(15, "cat"), "cat", new ArrayList<String>(List.of("link")),
                new ArrayList<Tag>(List.of(new Tag(14, "tag"))),
                Pet.Status.available);
        int expectedStatus = 200;
        HashMap<Pet, Integer> newPet = petHTTP.createNewPet(expectedPet);
        Set<Pet> pets = newPet.keySet();
        Collection<Integer> values = newPet.values();
        Pet actualPet = null;
        int actualStatus = 0;
        for (Map.Entry<Pet, Integer> entry : newPet.entrySet()) {
            actualPet = entry.getKey();
            actualStatus = entry.getValue();
        }

        Assertions.assertEquals(expectedStatus, actualStatus);
        Assertions.assertEquals(expectedPet, actualPet);
    }

    @Test
    public void testThatGetPetByIdMethodWorksCorrect() throws IOException, InterruptedException {
        int expectedStatus = 200;
        Pet expectedPet = new Pet(777,
                new Category(0, "animal"), "Baloo best", new ArrayList<String>(List.of("string")),
                new ArrayList<Tag>(List.of(new Tag(0, "string"))),
                Pet.Status.available);

        Pet actualPet = petHTTP.getPetById(777);
        int actualStatus = petHTTP.getResponseStatus();
        Assertions.assertEquals(expectedStatus, actualStatus);
        Assertions.assertEquals(expectedPet, actualPet);
    }
}

